/*Table structure for table `api_t_progress` */

DROP TABLE IF EXISTS `api_t_progress`;

CREATE TABLE `api_t_progress` (
  `id` varchar(50) NOT NULL,
  `interface_id` varchar(50) DEFAULT NULL,
  `start_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL,
  `developer` varchar(255) DEFAULT NULL,
  `progress` smallint(6) DEFAULT NULL,
  `status` varchar(50) DEFAULT NULL COMMENT '新建:创建时设置\r\n            开始:状态为【新建】&&开始时间=当前时间(定时任务)\r\n            结束:更新进度时、当检测到进度为100时则更新为结束\r\n            逾期:状态为【开始】&&当前时间>结束时间(定时任务 )',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `create_user` varchar(50) DEFAULT NULL,
  `last_update_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `last_update_user` varchar(50) DEFAULT NULL,
  `version` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='接口管理表';

/*Data for the table `api_t_progress` */

/*Table structure for table `api_t_progress_log` */

DROP TABLE IF EXISTS `api_t_progress_log`;

CREATE TABLE `api_t_progress_log` (
  `id` varchar(50) NOT NULL,
  `content` text,
  `progress_id` varchar(50) DEFAULT NULL,
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `create_user` varchar(50) DEFAULT NULL,
  `last_update_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `last_update_user` varchar(50) DEFAULT NULL,
  `version` int(11) DEFAULT NULL,
  `memo` varchar(2048) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `api_t_progress_log` */

/*Table structure for table `api_t_project` */

DROP TABLE IF EXISTS `api_t_project`;

CREATE TABLE `api_t_project` (
  `id` varchar(50) NOT NULL,
  `name` varchar(255) DEFAULT NULL,
  `start_date` date DEFAULT NULL,
  `leader` varchar(50) DEFAULT NULL,
  `test_url` varchar(1024) DEFAULT NULL,
  `production_url` varchar(1024) DEFAULT NULL,
  `svn_url` varchar(1024) DEFAULT NULL,
  `description` varchar(1024) DEFAULT NULL,
  `parent_id` varchar(50) DEFAULT NULL,
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `create_user` varchar(50) DEFAULT NULL,
  `last_update_date` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `last_update_user` varchar(50) DEFAULT NULL,
  `version` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='项目表';

